import React from 'react';
import classNames from 'classnames';
import classes from './Cockpit.module.css';
// //import rocky from '../../containers/App.module.css'
// import classNames from 'classnames';
// import classes from './Cockpit.module.css';
// import Navbar from './navBar';

const viewContentOptions = props => {
  //
  let displayOptions = (
    <React.Fragment>
      <div>
        <div className="btn-group-toggle d-flex-between" data-toggle="buttons">
          <label className="btn btn-danger m-2 active">
            <button
              type="radio"
              name="options"
              id="option1"
              autoComplete="off"
              onClick={props.viewContent}
              value="0"
            />{' '}
            Cockpit
          </label>

          <label className="btn btn-primary m-2 active">
            <button
              type="radio"
              name="options"
              id="option1"
              autoComplete="off"
              onClick={props.viewContent}
              value="1"
            />{' '}
            Tasks of the Week
          </label>

          <div class="dropdown  ">
            <button
              class="btn btn-success m-2 active dropdown-toggle"
              type="button"
              id="dropdownMenuButton"
              data-toggle="dropdown"
              aria-haspopup="true"
              aria-expanded="false"
            >
              Tasks By Day
            </button>

            <div class="dropdown-menu" aria-labelledby="dropdownMenuButton">
              <label className="btn btn-success m-2 active ">
                <button
                  type="button"
                  name="options"
                  id="option2"
                  autoComplete="off"
                  onClick={props.viewContent}
                  value="2"
                />{' '}
                Monday
              </label>
              <label className="btn btn-success m-2 active ">
                <button
                  type="button"
                  name="options"
                  id="option2"
                  autoComplete="off"
                  onClick={props.viewContent}
                  value="2"
                />{' '}
                Tuesday
              </label>
              <label className="btn btn-success m-2 active ">
                <button
                  type="button"
                  name="options"
                  id="option2"
                  autoComplete="off"
                  onClick={props.viewContent}
                  value="2"
                />{' '}
                Wednesday
              </label>
            </div>
          </div>

          <label className="btn btn-warning m-2 ">
            <button
              type="radio"
              name="options"
              id="option3"
              autoComplete="off"
              onClick={props.viewContent}
              value="3"
            />{' '}
            React Syllabus
          </label>
        </div>
      </div>
    </React.Fragment>
  );

  return displayOptions;
};

export default viewContentOptions;
